import React from 'react';
import PropTypes from "prop-types"

import "./Login.css"

export default function Login({setToken}) {
    const [username, setUserName] = useState();
    const [password, setPassword] = useState();
  return(
    <div id="login-container">
        <h1 id="login-title">Login</h1>
        <form autoComplete={"off"}>
        <div id='username-label-div'>
            <label>
                <input className="login-text-input" type="text" placeholder="username"/>
            </label>
        </div>
        <div id='password-label-div'>
            <label>
                <input className="login-text-input" type="password" placeholder="password" autoComplete={"off"} />
            </label>
        </div>
        <div id='login-btn-div'>
            <button onClick={() => (console.log("button clicked"))}>Login</button>
        </div>
        </form>
    </div>
  )
}

Login.propTypes = {
    setToken: PropTypes.func.isRequired
}
